import React from "react";
import { useParams } from "react-router-dom";
import { useSelector } from "react-redux";

function Work() {
  const todos = useSelector((state) => state.todos);
  const param = useParams();
  return;
  <div>
    {todos.map((item) => {
      if (item.id === param.id) {
        return (
          <div>
            <div>{item.id}</div>
          </div>
        );
      }
    })}
  </div>;
}

export default Work;
